
import './App.css'
import NavBar from './pages/navBar'
import { Routes, Route } from 'react-router-dom'
import { useState } from 'react'
import { v4 as uuid } from 'uuid'
import ListMovie from './pages/ListMovie'
import MovieForm from './pages/MovieForm'
import MoreInfo from './pages/MoreInfo'



function App() {

  const [movie, setMovie] = useState([
    {
      id: uuid(),
      title: "2012",
      trailer: "https://www.youtube.com/embed/sFXGrTng0gQ?si=kWSb5Avhez_ed-MY",
      description: "En 2009, le géophysicien Adrian Helmsley est appelé par son collègue indien Satnam pour lui faire part d'une découverte dans la mine la plus profonde d'Inde.",
      posterURL: "data:image/jpeg;base64,",
      rating: 2.0
    },
    {
      id: uuid(),
      title: "Inception",
      trailer: "https://www.youtube.com/embed/8hP9D6kZseM?si=Xl0c1WqRtgLFOM4a",
      description: "Dom Cobb, un voleur capable d'extraire des secrets du subconscient pendant les rêves, se voit offrir une chance de retrouver sa vie normale.",
      posterURL: "data:image/jpeg;base64,",
      rating: 3.8
    },
    {
      id: uuid(),
      title: "Interstellar",
      trailer: "https://www.youtube.com/embed/zSWdZVtXT7E?si=NgBF84ld98vVH4KZ",
      description: "Une équipe d'explorateurs voyage à travers un trou de ver dans l'espace dans une tentative de sauver l'humanité.",
      posterURL: "data:image/jpeg;base64,",
      rating: 4.6
    },
    {
      id: uuid(),
      title: "The Dark Knight",
      trailer: "https://www.youtube.com/embed/EXeTwQWrcwY?si=t7_mBMhvsjdnKz3U",
      description: "Batman fait face à un nouveau défi lorsqu'un criminel connu sous le nom du Joker plonge Gotham City dans le chaos.",
      posterURL: "data:image/jpeg;base64,",
      rating: 5.0
    }

  ]
  )

  const addMovie = (newMovie) => {
    setMovie(oldMovie => {
      return [...oldMovie, newMovie]
    })
  }
  const deleteMovie=(id)=>{
    setMovie(oldMovie=>{
      return  oldMovie.filter(el=>el.id!=id)
    })
  }

  return (
    <>
      <NavBar />


      <Routes>

        <Route path="/" element={<ListMovie movie={movie} deleteMovie={deleteMovie}  />} />
        <Route path="/add" element={<MovieForm addMovie={addMovie}   />} />
        <Route path="/info/:id" element={<MoreInfo movie={movie} />} />



      </Routes>
    </>
  )
}

export default App
